import React from 'react';
import Time from './time';
import { Link } from "react-router-dom";


const AppMain = () => {
    return ( 
        <div className="appMain">
            <h1 className="mainHeader">Software Developer</h1>
            <div className="clockContainer">
                <div className="cityClock">
                    <div className="city">Tokyo</div>
                    <Time timeZone={32400}/>
                </div>
                <div className="cityClock">
                    <div className="city">LosAngeles</div>
                    <Time timeZone={"LA"}/>
                </div>
                <div className="cityClock">
                    <div className="city">London</div>
                    <Time timeZone={3600}/>
                </div>
            </div>
            <Link Link to="www.linkedin.com/in/TakatoCox">
            <img alt="link" src="https://img.icons8.com/office/48/000000/linkedin.png"/>   
            </Link>
        </div>  
            );
}
 
export default AppMain;
